import axios from 'axios'

const Index = ({ data }) => (
    <span>Index</span>
)

Index.getInitialProps = async () => {
    const result = await 
    axios.get('/github/search/repositories?q=react')
      .then(resp => {
        console.log(resp);
        return resp
      })

    return {
        data: result.data
    }
}

export default Index;
